import React, { useState, useEffect } from 'react';

const Contact = () => {
    const [contacts, setContacts] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                // Use fetch instead of axios
                const response = await fetch('http://localhost/fetchcontacts.php');
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                const data = await response.json();
                console.log("res ", data);
                // Assuming the JSON structure includes a contacts array directly
                setContacts(data.contacts || []); // Fallback to an empty array if contacts is undefined
            } catch (error) {
                console.error('Error fetching contacts:', error);
            }
        };

        fetchData();
    }, []);

    return (
        <div>
            <h2>Contacts</h2>
            <ul>
                {contacts.map((contact, index) => (
                    <li key={index}>
                        <p>Name: {contact.Name}</p> {/* Note: Adjusted to match the JSON property names */}
                        <p>Phone: {contact.Phone}</p>
                        <p>Email: {contact.Email}</p>
                        <br />
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Contact;
